int lengthOfLongestSubstring(string s) {
	int st[128];
	vector<int> index;
	memset(st, 0, 128 * 4);
	int length = 0;
	for(size_t i = 0; i < s.size(); ++i)
	{
		char c = s[i];
		int j = c - '\0';
		if(!st[j])
		{
			st[j] = i + 1;
			index.push_back(i + 1);
		}
		else
		{
			for(auto k = index.begin(); k != index.end(); )
			{
				if(*k <= st[j])
				{
					k = index.erase(k);
					//if(n == index.end())
					//	break;
				}
				else
					break;


			}
			st[j] = i + 1;
			index.push_back(i + 1);
		}

		if(index.size() > length)
			length = index.size();
	}

	return length;
}

